  return (
    <Grid container direction="column">
      <Grid item>
        <Box pb={2}>
          <Typography style={{fontSize: 14}}>QUESTIONS & ANSWERS</Typography>
        </Box>
      </Grid>
      <Grid item>
        <Questions product_id={product_id} name={name} />
      </Grid>
    </Grid>
  );
}

export default QA;
